import "./Aboutme.css";
import spacelogo from "./images/spacelogo.png";

function Aboutme() {
  return (
    <div className="Aboutme">
      <header className="Aboutme-header">
        <img src={spacelogo} className="logo" alt="logo" />
        <p>Shiv Patel</p>
        <a href="https://Github.com/shivpvtel">Github</a>
      </header>
    </div>
  );
}

export default Aboutme;
